func (c *current) onDecl1(docstring, decl any) (any, error) {
	switch node := decl.(type) {
	case *InterfaceDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *UnionDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *EnumDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *ScalarDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *ClassDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *SlotDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *DirectiveDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	case *NewConstructorDecl:
		if docstring != nil {
			node.DocString = docstring.(string)
		}
		return node, nil
	default:
		return decl, nil
	}
}

